Nice work — this is a thoughtful, pragmatic event system with careful handling of deduplication, reentrancy, cross-tab broadcasts, and an SSE bridge. Overall architecture is solid and the implementation covers a lot of tricky cases. Below I summarize strengths, potential issues, and actionable improvements you can make quickly.

High-level strengths
- Clear separation: in-process bus, server SSE mount, ingest endpoint, and browser client are cleanly separated and composable.
- Dedup + bounded memory: the seen/ order ring buffer prevents unbounded memory growth from duplicate events.
- Reentrancy-safe emit: queue + flushing prevents stack overflows and odd reentrant ordering.
- Cross-tab and SSE merging: BroadcastChannel + shared EventSource integration is a good model for multi-tab UIs.
- onKey for single active listener is a nice pattern for hot reload/service replacement.

Potential issues and suggested fixes

1) Duplicate EventSource listener registration (browser)
- Problem: when EventSource is already open and multiple subscribers call addType for the same `type`, you call `es.addEventListener(type, forward(type))` each time — this registers the same callback multiple times and will cause duplicate forwards.
- Fix: track which types you've already registered with the ES instance and only call addEventListener once per type.
- Minimal change:
  ```js
  let registeredTypes = new Set();

  const ensureES = () => {
    if (es || !_isBrowser() || !window.EventSource) return;
    es = new EventSource(eventsUrl);
    // core types
    ["hello","run:started","run:finished","run:error","message"].forEach(t => {
      es.addEventListener(t, forward(t));
      registeredTypes.add(t);
    });
  };

  // inside addType when es exists:
  if (es && !registeredTypes.has(type)) {
    es.addEventListener(type, forward(type));
    registeredTypes.add(type);
  }
  // when closing ES, clear registeredTypes
  ```
  That prevents duplicate invocations.

2) Order.shift() cost in _markSeen (potential perf hot path)
- Problem: `order.shift()` is O(n). If event throughput is very high and maxSeen is large, repeatedly shifting can cost CPU.
- Options:
  - Use a circular buffer implementation (head/tail indices).
  - Or keep a Map from id -> insertionTs and periodically prune oldest entries in batches.
- Simple circular-buffer idea:
  ```js
  const order = new Array(maxSeen);
  let head = 0, size = 0;
  function pushOrder(id) {
    if (size < maxSeen) {
      order[(head + size) % maxSeen] = id;
      size++;
    } else {
      // overwrite head
      const old = order[head];
      seen.delete(old);
      order[head] = id;
      head = (head + 1) % maxSeen;
    }
  }
  ```
  This avoids repeated O(n) array shifts.

3) Silent error swallowing in many catch blocks
- Problem: you have many `catch {}` that swallow errors silently. This makes debugging hard and can hide serious issues.
- Suggestion: accept an optional logger (or respect console) and log with a debug level, e.g. `catch (err) { logger?.warn?.(err) }`. For production, you can keep logs disabled, but during development this helps.

4) EventSource lifecycle and reconnection handling
- Consider handling `error`/`open` events to detect broken connections and to attempt explicit reconnect or to clear state accordingly. Also ensure that when ES is closed due to refCount 0 you actually remove all server-side listeners and clear `registeredTypes`.

5) addAny vs addType and ensureES
- You currently call `addRef()` in `addAny`, which triggers `ensureES()`. Good. Just ensure `message` listener is kept for "any" events (you already added it in core set).

6) mountEventsSSE: headers, flush, and framework assumptions
- `router.get(path, (_args, ctx) => { const res = ctx?.res || ctx; res.writeHead?.(200, {...}) ... return { status: 200 } })` assumes a specific server/router shape. That works for many frameworks but double-check for Koa/Express variants (Koa uses `ctx.res` but expects `ctx.status`). Consider documenting supported frameworks or making a small adapter.
- Consider calling `res.flush?.()` or `res.flushHeaders?.()` after setting headers to ensure proxies don't buffer (if supported by runtime).
- Add optional CORS headers or authentication hooks as needed for production.

7) mountEventsIngest: validation & security
- Validate incoming payload: ensure `type` is present and is a string (you do), but also guard sizes and types for `payload` and `meta` (to avoid huge JSON bodies).
- Check Content-Type & body size; add rate-limiting, auth, and CSRF considerations if exposing publicly.
- Consider adding an ingest-specific `source` or `auth` field to avoid spoofed events from clients in collaborative setups.

8) global/persistent maps in non-browser environments
- You set `_sharedByUrl` to a `new Map()` in non-browser contexts. That’s harmless but not needed; maybe set to null or keep consistent shape. Also ensure global singletons don’t leak in serverless environments between invocations (you probably want that sometimes but be explicit).

9) awaitFinal and backstop
- The awaitFinal flow is solid. Consider making `backstopMs` configurable per-call (you already allow it) and ensure `offFin/offErr` are removed on cancel (you do via cleanup).
- One small edge: if `fetchRunStatus` throws synchronously, you propagate; seems fine.

Other small improvements
- Add JSDoc or TypeScript types for the public API to improve DX.
- Add unit tests for:
  - Reentrancy (handler emits new events)
  - Dedup semantics
  - Multi-tab behavior (simulate BroadcastChannel)
  - SSE subscriptions & duplicate-type scenario (before/after fix)
- Consider exposing a small statistic endpoint (or _debug already provided) for monitoring.

Suggested priorities to land
1. Fix duplicate EventSource listener registration (high bug probability).
2. Replace array.shift ring buffer with circular buffer if you expect heavy throughput (performance).
3. Replace empty catches with optional debug logging (observability).
4. Add basic input validation and limits for ingest path (security/stability).
5. Add unit tests covering reentrancy and dedupe.

If you want, I can:
- Prepare a PR with the ES registration fix + registeredTypes + small tests.
- Convert the ordering buffer to a circular-buffer implementation and show microbenchmarks.
- Add optional debug logging hooks and show where to place them.

Which of those would you like me to produce as a patch first?

