Short answer: return both. The simplest, readable pattern is to return an object with the optimistic value and a promise for the final value.

Example:
function saveTodo(input) {
  // 1) Build optimistic value (e.g., temp id)
  const optimistic = { id: 'temp-' + crypto.randomUUID(), ...input, status: 'pending' };

  // 2) Kick off the real request
  const final = fetch('/api/todos', {
    method: 'POST',
    headers: { 'content-type': 'application/json' },
    body: JSON.stringify(input),
  })
    .then(r => {
      if (!r.ok) throw new Error('Save failed');
      return r.json();
    });

  // 3) Return both
  return { optimistic, final };
}

// Usage
const { optimistic, final } = saveTodo({ text: 'Buy milk' });
// Use optimistic immediately
renderTodo(optimistic);

try {
  const saved = await final;
  // Reconcile optimistic -> real
  replaceTodo(optimistic.id, saved);
} catch (e) {
  // Roll back UI or mark as failed
  removeTodo(optimistic.id);
  showError(e.message);
}

Why this is idiomatic
- Explicit and readable: the shape makes intent clear.
- Easy to type (TS) and test.
- No Promise mutation or magic; works in any environment.
- Encourages clear reconciliation/rollback paths.

Two other common variants (trade-offs)
- Promise with an extra property:
  const p = save().then(...);
  p.optimistic = optimistic;
  return p;
  + Very terse usage: const p = save(...); use(p.optimistic); await p;
  − Less explicit, harder to type, can confuse linters.

- Async generator (stream states):
  async function* saveTodoGen(input) {
    yield { kind: 'optimistic', value: optimistic };
    yield { kind: 'final', value: await final };
  }
  + Natural if you may emit more states (progress, retries).
  − More ceremony to consume; overkill for two states.

Pick the object-return pattern unless you need streaming states. It’s minimal, explicit, and easy to maintain.

It can work, but it’s less idiomatic than returning a Promise. If you do it, make the callback just sugar over a Promise so late subscribers still fire and errors are handled.

Minimal implementation:
function saveTodo(input) {
  const optimistic = { id: 'temp-' + crypto.randomUUID(), ...input, status: 'pending' };
  const final = fetch('/api/todos', {
    method: 'POST',
    headers: { 'content-type': 'application/json' },
    body: JSON.stringify(input),
  }).then(r => {
    if (!r.ok) throw new Error('Save failed');
    return r.json();
  });

  return {
    optimistic,
    onFinal(cb, onError) {
      let cancelled = false;
      final.then(
        value => { if (!cancelled) cb(value); },
        err => { if (!cancelled && onError) onError(err); }
      );
      return () => { cancelled = true; }; // optional unsubscribe
    },
  };
}

// Usage
const { optimistic, onFinal } = saveTodo({ text: 'Buy milk' });
renderTodo(optimistic);
const cancel = onFinal(
  saved => replaceTodo(optimistic.id, saved),
  err => { removeTodo(optimistic.id); showError(err.message); }
);

Notes and trade-offs:
- Pros: Simple to consume in callback-style code; you can support multiple subscribers or provide unsubscribe.
- Cons: Less composable than a Promise (can’t await, harder to use with Promise.all/race); you must design error and unsubscribe semantics; easy to create inconsistent APIs if some calls use callbacks and others use promises.
- If you already have the promise, you can expose both with no extra cost:
  return { optimistic, final, onFinal: (cb, onErr) => { final.then(cb, onErr); } };
  Then callers choose: await final or onFinal(cb).

Unless you specifically need push-style or multiple listeners, prefer returning a Promise for the final result and optionally add onFinal as convenience. It keeps the API predictable and easy to compose.

