Here’s a minimal, readable pattern that returns { optimistic, final } without changing your external API. It computes an immediate optimistic value (prefer stub), and a promise for the authentic result that follows your beforeRun/afterRun/runServer flow.

```js
function callOptimistic(name, args = {}, ctx = {}) {
  const t = tools.get(name);

  // If no local tool, we can’t form a good optimistic value. Return null and a remote promise.
  if (!t) {
    return {
      optimistic: null,
      final: (async () => {
        try {
          return await callRemote(name, args, ctx);
        } catch (err) {
          // bubble up; caller handles rollback
          throw err;
        }
      })(),
    };
  }

  let { stub, handler, beforeRun, afterRun, runServer } = t;
  afterRun = afterRun || stub || null;    // your original precedence
  runServer = runServer || handler || null;

  // 1) Build optimistic immediately (keep it pure; avoid side-effects)
  // Prefer stub; otherwise a lightweight echo with a marker.
  let optimistic;
  try {
    if (typeof stub === "function") {
      optimistic = stub(args, ctx);
    } else {
      optimistic = { ...args, _optimistic: true };
    }
  } catch (e) {
    // Never throw from optimistic path; let final be authoritative
    optimistic = { ...args, _optimistic: true, _optimisticError: String(e) };
  }

  // 2) Kick off the real work; validate, honor beforeRun, pick remote/local, apply afterRun
  const final = (async () => {
    const schema = await resolveParameters(t, ctx);
    const v = validate(schema, args);
    if (!v.ok) throw new Error(v.error);
    let runArgs = v.value;

    // beforeRun can request async/remote and supply runArgs
    if (typeof beforeRun === "function") {
      const hint = await beforeRun(runArgs, ctx);
      if (hint && typeof hint === "object") {
        if ("runArgs" in hint && hint.runArgs) runArgs = hint.runArgs;
        if (hint.async && isBrowser() && typeof runServer === "function") {
          const result = await callRemote(name, runArgs, ctx);
          return typeof afterRun === "function"
            ? afterRun(runArgs, { ...ctx, result })
            : result;
        }
      }
    }

    // Normal browser path: prefer server if available
    if (isBrowser() && typeof runServer === "function") {
      const result = await callRemote(name, runArgs, ctx);
      return typeof afterRun === "function"
        ? afterRun(runArgs, { ...ctx, result })
        : result;
    }

    // No server path; afterRun takes precedence, else handler/stub
    if (typeof afterRun === "function") return await afterRun(runArgs, ctx);
    if (typeof handler === "function") return await handler(runArgs, ctx);
    if (typeof stub === "function") return await stub(runArgs, ctx);

    throw new Error(`No execution path for tool: ${name}`);
  })();

  return { optimistic, final };
}
```

Usage
```js
const { optimistic, final } = callOptimistic("saveTodo", { text: "Buy milk" }, { userId });
renderTodo(optimistic);

try {
  const saved = await final;
  reconcile(optimistic, saved);  // e.g., replace temp id, clear pending flags
} catch (e) {
  rollback(optimistic);
  showError(e.message);
}
```

Notes
- Keep stub pure and fast; don’t mutate shared state. It’s for optimistic UI only.
- Let final be the single source of truth; use it to reconcile or roll back.
- This shape composes well (Promise.all, races, retries) and stays explicit and easy to test.

